import React, { useState, useEffect } from "react";
import "../../index.css";

const UserList = () => {
  const [users, setUsers] = useState([]);

  const f = async () => {
    const res = await fetch("https://reqres.in/api/users/");
    const json = await res.json();
    setUsers(json.data);
  };

  useEffect(() => {
    f();
  }, []);

  return (
    <div className="App">
        <section class="py-5 bg-light">
          <div class="container px-5 my-5">
            <div class="text-center mb-5">
              <h1 class="fw-bolder">List User</h1>
            </div>

            <div class="row gx-5 content-center">
              {users.length &&
                users.map((user) => {
                  return (
                    <div key={item.id} class="col-xl-4 mb-5">
                      <Link to={`/course/${item.slug}`} className="uk-link-reset">
                        <div class="card mb-5 mb-xl-0">
                          <div class="card-body p-5">
                            <div class="mb-3 text-center">
                              <span class="fw-bolder"><img key={user.avatar} src={user.avatar} /></span>
                            </div>
                            <div class="text-center">
                              <span>{user.first_name}</span>
                              <p>{user.email}</p>
                            </div>
                          </div>
                        </div>
                      </Link>
                    </div>
                  );
                })}
            </div>
          </div>
        </section>
    </div>
  );
}

export default UserList;
